import './App.css';
import React from 'react';
import DateTime from './DateTime'
import image from "./task icon.png"

export default function WelcomeBanner({name}) {
    return (
        <section>
            <div className="row">
                <h1 className="col-md-9" style={{color: 'lightblue', align: 'center'}}>Hello {name}</h1>
                <div className="col-md-2">
                    <DateTime style={{padding:"50px"}}/>
                </div>
                <div className="col-md-1">
                    <img src={image} height={100} alt={"Handover Task Screen"}/>
                </div>
            </div>
        </section>
    );
}
